import{r as a,o as c,c as s,a as e,b as t,w as o,F as d,d as _,e as p}from"./app.9aaa2256.js";import{_ as i}from"./plugin-vue_export-helper.21dcd24c.js";const l={},h=_('<h3 id="\u5982\u4F55\u7ED9\u5B9D\u5B9D\u52A0\u8F85\u98DF" tabindex="-1"><a class="header-anchor" href="#\u5982\u4F55\u7ED9\u5B9D\u5B9D\u52A0\u8F85\u98DF" aria-hidden="true">#</a> \u5982\u4F55\u7ED9\u5B9D\u5B9D\u52A0\u8F85\u98DF\uFF1F</h3><p>\u600E\u6837\u7ED9\u5B9D\u5B9D\u6DFB\u52A0\u8F85\u98DF\uFF1F\u662F\u6BCF\u4E2A\u5BB6\u957F\u90FD\u8981\u9762\u5BF9\u7684\u95EE\u9898\u3002\u867D\u7136\u76F8\u5173\u79D1\u666E\u5F88\u591A\uFF0C\u4F46\u540E\u53F0\u4ECD\u770B\u5230\u5BB6\u957F\u5728\u8FD9\u91CC\u67E5\u8BE2\uFF0C\u53EF\u80FD\u662F\u60F3\u6709\u4E00\u4EFD\u8BE6\u7EC6\u800C\u786E\u5207\u7684\u6307\u5BFC\u3002\u4ECA\u5929\u63A8\u8350\u4E00\u7BC7\u6211\u89C9\u5F97\u5F88\u597D\u7684\u6587\u7AE0\uFF0C\u662F\u97E9\u533B\u751F\u5199\u7684\u6FB3\u6D32\u5173\u4E8E\u8F85\u98DF\u6DFB\u52A0\u7684\u610F\u89C1\u3002</p><p><strong>\u4F55\u65F6\u5F00\u59CB\u6DFB\u52A0\u8F85\u98DF</strong></p><p>\u5B9D\u5B9D\u4EEC\u5E94\u8BE5\u5728\u516D\u4E2A\u6708\u5DE6\u53F3\u5F00\u59CB\u6DFB\u52A0\u8F85\u98DF\u3002\u8FD9\u662F\u6FB3\u6D32\u7684\u6700\u65B0\u5EFA\u8BAE\u4E5F\u662F\u4E16\u754C\u536B\u751F\u7EC4\u7EC7\u7684\u6700\u65B0\u5EFA\u8BAE\u3002</p><p>\u5728\u516D\u4E2A\u6708\u4E4B\u524D\uFF0C\u6BCD\u4E73\u6216\u8005\u914D\u65B9\u5976\u7C89\u5B8C\u5168\u53EF\u4EE5\u6EE1\u8DB3\u5B9D\u5B9D\u7684\u6240\u6709\u8425\u517B\u9700\u6C42\u3002\u5728\u516D\u4E2A\u6708\u4E4B\u540E\uFF0C\u7531\u4E8E\u5B9D\u5B9D\u7684\u8425\u517B\u9700\u6C42\u589E\u52A0\uFF08\u7279\u522B\u662F\u94C1\u7684\u9700\u6C42\uFF09\uFF0C\u9700\u8981\u901A\u8FC7\u6DFB\u52A0\u8F85\u98DF\u6765\u6EE1\u8DB3\u3002\u5982\u679C\u8FC7\u665A\u6DFB\u52A0\u8F85\u98DF\uFF0C\u4E0D\u4EC5\u5B9D\u5B9D\u9762\u4E34\u8425\u517B\u4E0D\u826F\u7684\u98CE\u9669\uFF08\u7279\u522B\u662F\u7F3A\u94C1\u6027\u8D2B\u8840\uFF09\uFF0C\u8FD8\u53EF\u80FD\u51FA\u73B0\u504F\u98DF\uFF0C\u538C\u98DF\u7B49\u5582\u517B\u56F0\u96BE\u7684\u95EE\u9898\u3002</p><p>\u53E6\u5916\uFF0C\u8003\u8651\u5230\u5A74\u5E7C\u513F\u541E\u54BD\u529F\u80FD\u548C\u80C3\u80A0\u9053\u529F\u80FD\u7684\u53D1\u80B2\u7279\u70B9\uFF0C\u8F85\u98DF\u6DFB\u52A0\u8FC7\u65E9\u4E5F\u662F\u4E0D\u59A5\u7684\u3002</p><p><strong>\u5982\u4F55\u6DFB\u52A0\u8F85\u98DF</strong></p><p>\u7B2C\u4E00\u9636\u6BB5\uFF1A\u5C1D\u8BD5\u98DF\u7269\u7684\u5473\u9053\uFF08\u516D\u81F3\u4E03\u4E2A\u6708\uFF09</p><p>\u8FD9\u4E2A\u9636\u6BB5\u4E3B\u8981\u662F\u7ED9\u5B9D\u5B9D\u5C1D\u8BD5\u5404\u79CD\u4E0D\u540C\u98DF\u7269\u7684\u5473\u9053\uFF0C\u901A\u5E38\u662F\u5C11\u91CF\u7684\u7CCA\u72B6\u8F85\u98DF\uFF0C\u53EF\u4EE5\u5728\u5582\u5B8C\u6BCD\u4E73\u6216\u8005\u914D\u65B9\u5976\u4E4B\u540E\uFF0C\u7B49\u4E00\u4E2A\u5C0F\u65F6\u518D\u5582\u8F85\u98DF\u3002\u521A\u5F00\u59CB\u7684\u51E0\u5929\uFF0C\u53EF\u4EE5\u662F\u6BD4\u8F83\u7A00\u7684\u7CCA\u72B6\u8F85\u98DF\uFF1B\u7136\u540E\uFF0C\u6162\u6162\u589E\u52A0\u7A20\u5EA6\uFF1B\u6700\u540E\u8FDB\u5C55\u5230\u5939\u6742\u6709\u5C11\u91CF\u7EC6\u8F6F\u5C0F\u7599\u7629\u7684\u7CCA\u72B6\u98DF\u7269\u3002</p><p>\u8F85\u98DF\u6DFB\u52A0\u5F00\u59CB\u7684\u65F6\u5019\uFF0C\u5EFA\u8BAE\u6BCF\u5929\u4E00\u6B21\uFF1B\u7B49\u5B9D\u5B9D\u6162\u6162\u4E60\u60EF\u4E4B\u540E\uFF0C\u4FBF\u53EF\u4EE5\u589E\u52A0\u5230\u6BCF\u5929\u4E24\u5230\u4E09\u6B21\u3002</p><p>\u516D\u4E2A\u6708\u5F00\u59CB\uFF0C\u5B9D\u5B9D\u7684\u94C1\u9700\u6C42\u4F1A\u589E\u52A0\uFF0C\u56E0\u6B64\u8F85\u98DF\u91CC\uFF0C\u81F3\u5C11\u5305\u542B\u4E00\u79CD\u542B\u94C1\u4E30\u5BCC\u7684\u98DF\u7269\u3002\u4F8B\u5982\uFF0C\u94C1\u52A0\u5F3A\u7C73\u7CCA\u9EA6\u7CCA\uFF08\u6CE8\u610F\uFF0C\u81EA\u5236\u7684\u7C73\u7CCA\u6216\u8005\u9EA6\u7CCA\uFF0C\u6CA1\u6709\u94C1\u52A0\u5F3A\uFF0C\u56E0\u6B64\u4E0D\u5C5E\u4E8E\u542B\u94C1\u4E30\u5BCC\u7684\u98DF\u7269\uFF09\uFF0C\u8089\u6CE5\uFF0C\u8C46\u8150\u6CE5\uFF0C\u8C46\u6CE5\u7B49\u3002\u9664\u4E86\u8FD9\u4E2A\u51C6\u5219\u4E4B\u5916\uFF0C\u5176\u4ED6\u7684\u98DF\u7269\u901A\u5E38\u6CA1\u6709\u4E25\u683C\u7684\u89C4\u5B9A\uFF0C\u5988\u5988\u4EEC\u53EF\u4EE5\u81EA\u884C\u51B3\u5B9A\u8F85\u98DF\u6DFB\u52A0\u7684\u6B21\u5E8F\u4EE5\u53CA\u79CD\u7C7B\u3002</p><p>\u53EF\u80FD\u5988\u5988\u4EEC\u4F1A\u53D1\u73B0\u5728\u521A\u521A\u5F00\u59CB\u6DFB\u52A0\u8F85\u98DF\u7684\u65F6\u5019\uFF0C\u5B9D\u5B9D\u4F1A\u7528\u820C\u5934\u628A\u98DF\u7269\u9876\u51FA\u6765\u3002\u8FD9\u662F\u4E00\u4E2A\u6B63\u5E38\u73B0\u8C61\uFF0C\u5B83\u5E76\u4E0D\u4EE3\u8868\u5B9D\u5B9D\u5C31\u4E0D\u7231\u8FD9\u79CD\u98DF\u7269\u3002\u6709\u65F6\u5019\uFF0C\u67D0\u79CD\u98DF\u7269\u53EF\u80FD\u9700\u8981\u5C1D\u8BD58-10\u6B21\u4E4B\u540E\uFF0C\u5B9D\u5B9D\u624D\u4F1A\u5F00\u59CB\u63A5\u53D7\u3002</p><p>\u5728\u8FD9\u4E2A\u9636\u6BB5\uFF0C\u6BCD\u4E73\u6216\u8005\u914D\u65B9\u5976\u4ECD\u7136\u5341\u5206\u91CD\u8981\u3002\u8F85\u98DF\u5E94\u8BE5\u5728\u5582\u5B8C\u6BCD\u4E73\u6216\u8005\u914D\u65B9\u5976\u4E4B\u540E\u518D\u5582\u3002</p><p>\u7B2C\u4E8C\u9636\u6BB5\uFF1A\u5B66\u4E60\u5480\u56BC\uFF08\u4E03\u81F3\u4E5D\u4E2A\u6708\uFF09</p><p>\u5927\u591A\u6570\u5B9D\u5B9D\uFF0C\u5728\u5F00\u59CB\u6DFB\u52A0\u8F85\u98DF\u4E4B\u540E\u4E0D\u4E45\uFF0C\u4FBF\u53EF\u4EE5\u63A5\u53D7\u6BD4\u8F83\u7C98\u7A20\u6216\u8005\u5E26\u6709\u8F6F\u7599\u7629\u7684\u7CCA\u72B6\u98DF\u7269\u3002\u4E00\u65E6\u53D1\u73B0\u5B9D\u5B9D\u81EA\u5DF1\u53EF\u4EE5\u72EC\u5750\u5E76\u6709\u5480\u56BC\u7684\u52A8\u4F5C\u51FA\u73B0\uFF0C\u90A3\u4E48\u5373\u4F7F\u5B9D\u5B9D\u8FD8\u6CA1\u6709\u7259\u9F7F\uFF0C\u4E5F\u53EF\u4EE5\u5F00\u59CB\u9F13\u52B1\u5B9D\u5B9D\u8FDB\u884C\u5480\u56BC\u7684\u7EC3\u4E60\u4E86\u3002\u5E26\u6709\u8F6F\u7599\u7629\u7684\u7CCA\u72B6\u98DF\u7269\u6216\u8005\u5C0F\u5757\u7684\u67D4\u8F6F\u98DF\u7269\u901A\u5E38\u662F\u5F88\u597D\u7684\u5E2E\u52A9\u5B9D\u5B9D\u7EC3\u4E60\u5480\u56BC\u7684\u98DF\u7269\u3002\u7EC3\u4E60\u5480\u56BC\u4E0D\u4EC5\u6709\u52A9\u4E8E\u953B\u70BC\u5480\u56BC\u808C\u4E5F\u53EF\u4EE5\u5E2E\u52A9\u5C06\u6765\u5B9D\u5B9D\u7684\u8BED\u8A00\u53D1\u80B2\u3002</p><p>\u8FD9\u4E2A\u9636\u6BB5\u7684\u5B9D\u5B9D\u5DF2\u7ECF\u4F1A\u901A\u8FC7\u89C2\u5BDF\u5988\u5988\u7684\u52A8\u4F5C\u800C\u6A21\u4EFF\u3002\u56E0\u6B64\uFF0C\u5988\u5988\u4EEC\u53EF\u4EE5\u7ED9\u5B9D\u5B9D\u505A\u5480\u56BC\u7684\u793A\u8303\u52A8\u4F5C\uFF0C\u4ECE\u800C\u6162\u6162\u6559\u4F1A\u5B9D\u5B9D\u8FDB\u884C\u5480\u56BC\u3002\u5F53\u5B9D\u5B9D\u521A\u5F00\u59CB\u63A5\u89E6\u7C98\u7A20\u6216\u8005\u5E26\u6709\u9897\u7C92\u7684\u98DF\u7269\u65F6\uFF0C\u53EF\u80FD\u4F1A\u51FA\u73B0\u4F5C\u5455\u7684\u52A8\u4F5C\uFF0C\u8FD9\u4E2A\u662F\u6B63\u5E38\u7684\u73B0\u8C61\uFF0C\u5988\u5988\u4EEC\u65E0\u9700\u60CA\u614C\u3002</p><p>\u5728\u5B9D\u5B9D\u4E03\u81F3\u4E5D\u4E2A\u6708\u5927\u7684\u65F6\u5019\uFF0C\u4E00\u5929\u53EF\u4EE5\u5403\u4E09\u6B21\u8F85\u98DF\uFF0C\u5927\u6982\u7C7B\u4F3C\u4E8E\u6210\u5E74\u4EBA\u7684\u65E9\uFF0C\u4E2D\uFF0C\u665A\u9910\u3002\u5F53\u5B9D\u5B9D\u4E00\u6B21\u80FD\u5403\u8F83\u591A\u7684\u8F85\u98DF\u65F6\u5019\uFF0C\u90A3\u4E48\u5988\u5988\u4EEC\u53EF\u4EE5\u5C1D\u8BD5\u5148\u5582\u8F85\u98DF\uFF0C\u7136\u540E\u518D\u5582\u6BCD\u4E73\u6216\u8005\u914D\u65B9\u5976\u7C89\u4E86\u3002</p><p>\u7B2C\u4E09\u4E2A\u9636\u6BB5\uFF1A\u5B66\u4E60\u81EA\u5DF1\u8FDB\u98DF\uFF08\u4E5D\u81F3\u5341\u4E8C\u4E2A\u6708\uFF09</p><p>\u901A\u5E38\uFF0C\u5B9D\u5B9D\u5728\u516B\u81F3\u4E5D\u6708\u5927\u7684\u65F6\u5019\u5F00\u59CB\u559C\u6B22\u81EA\u5DF1\u5582\u98DF\u3002\u5988\u5988\u4EEC\u5E94\u8BE5\u5C3D\u91CF\u9F13\u52B1\uFF0C\u5582\u5B9D\u5B9D\u51C6\u5907\u4E00\u4E9B\u53EF\u4EE5\u7528\u624B\u6307\u6293\u8457\u5403\u7684\u98DF\u7269\u3002\u5B66\u4E60\u81EA\u5DF1\u5582\u98DF\u662F\u4E00\u4E2A\u5F88\u91CD\u8981\u7684\u6280\u80FD\uFF0C\u867D\u7136\u521A\u5F00\u59CB\u5B9D\u5B9D\u4EEC\u4F1A\u628A\u5730\u677F\uFF0C\u684C\u5B50\uFF0C\u51F3\u5B50\u90FD\u5F04\u5F97\u4E00\u584C\u7CCA\u6D82\uFF0C\u4F46\u662F\u5988\u5988\u4EEC\u4ECD\u7136\u5E94\u8BE5\u9F13\u52B1\u548C\u652F\u6301\u3002</p><p>\u5728\u8FD9\u4E2A\u9636\u6BB5\uFF0C\u5988\u5988\u4EEC\u53EF\u80FD\u8FD8\u4F1A\u53D1\u73B0\u5B9D\u5B9D\u4F1A\u62FF\u7740\u98DF\u7269\u628A\u73A9\uFF0C\u8FD9\u662F\u5B9D\u5B9D\u8BA4\u77E5\u7684\u4E00\u4E2A\u8FC7\u7A0B\uFF0C\u6240\u4EE5\u53EA\u8981\u4E0D\u662F\u8FC7\u5EA6\u7684\u6D6A\u8D39\uFF0C\u8BF7\u5988\u5988\u4EEC\u4E0D\u8981\u5236\u6B62\u3002\u540C\u65F6\uFF0C\u5988\u5988\u4EEC\u5E94\u8BE5\u5C3D\u91CF\u505A\u5230\u8BA9\u5B9D\u5B9D\u81EA\u5DF1\u51B3\u5B9A\u6BCF\u6B21\u8FDB\u98DF\u7684\u591A\u5C11\uFF0C\u4E0D\u8981\u8FC7\u5EA6\u6216\u8005\u5F3A\u8FEB\u8FDB\u98DF\u3002</p><p>\u4ECE\u4E5D\u4E2A\u6708\u5F00\u59CB\uFF0C\u5927\u591A\u6570\u5B9D\u5B9D\u5DF2\u7ECF\u5F00\u59CB\u4E00\u65E5\u4E09\u9910\u8F85\u98DF\uFF0C\u5728\u8FD9\u4E2A\u9636\u6BB5\uFF0C\u5988\u5988\u4EEC\u4E5F\u53EF\u4EE5\u8003\u8651\u7ED9\u5B9D\u5B9D\u6DFB\u52A0\u4E00\u5230\u4E24\u987F\u7684\u52A0\u9910\u3002\u53E6\u5916\uFF0C\u5728\u8FD9\u4E2A\u9636\u6BB5\uFF0C\u6BCD\u4E73\u6216\u914D\u65B9\u5976\u4ECD\u7136\u5341\u5206\u91CD\u8981\u3002</p><p>\u7B2C\u56DB\u4E2A\u9636\u6BB5\uFF1A\u878D\u5165\u6B63\u5E38\u7684\u5BB6\u5EAD\u996E\u98DF\uFF08\u5341\u4E8C\u4E2A\u6708\u53CA\u4EE5\u4E0A\uFF09</p><p>\u5F53\u5B9D\u5B9D\u4E00\u5468\u5C81\u4E4B\u540E\uFF0C\u5B9D\u5B9D\u7684\u996E\u98DF\u5E94\u8BE5\u4EE5\u5C11\u91CF\u591A\u9910\u4E3A\u51C6\u5219\u3002\u6BCF\u65E5\u4E09\u9910\uFF0C\u5916\u52A0\u4E00\u81F3\u4E8C\u987F\u7684\u5C0F\u9910\u3002\u5988\u5988\u4EEC\u4ECD\u7136\u9700\u8981\u6CE8\u610F\u5B9D\u5B9D\u8FDB\u98DF\u65F6\u53D1\u751F\u7A92\u606F\u7684\u5371\u9669\u3002</p><p>\u4E00\u5468\u5C81\u4E4B\u540E\uFF0C\u5B9D\u5B9D\u53EF\u4EE5\u559D\u5168\u8102\u7684\u725B\u5976\uFF08\u6CE8\u610F\uFF0C\u5FC5\u987B\u662F\u5168\u8102\uFF0C\u56E0\u4E3A\u5B9D\u5B9D\u751F\u957F\u9700\u8981\u4E00\u4E9B\u989D\u5916\u7684\u80FD\u91CF\uFF09\u3002\u540C\u65F6\uFF0C\u4E5F\u8981\u6CE8\u610F\u6BCF\u65E5\u725B\u5976\u7684\u6444\u5165\u91CF\uFF0C\u8FC7\u91CF\u7684\u725B\u5976\u4F1A\u5BFC\u81F4\u5B9D\u5B9D\u4E0D\u613F\u610F\u8FDB\u9910\uFF0C\u4ECE\u800C\u5BFC\u81F4\u5582\u517B\u56F0\u96BE\u3002\u8FD9\u4E2A\u9636\u6BB5\uFF0C\u6BCF\u5929\u7684\u5976\u91CF\u5E94\u8BE5\u63A7\u5236\u5728500\u6BEB\u5347\u4EE5\u5185\u3002</p><p>\u5B9D\u5B9D\u6700\u4F73\u7684\u996E\u6599\u4ECD\u7136\u662F\u6BCD\u4E73\uFF0C\u914D\u65B9\u5976\uFF0C\u5168\u8102\u725B\u5976\u548C\u767D\u5F00\u6C34\u3002\u4E0D\u5EFA\u8BAE\u8BA9\u5B9D\u5B9D\u559D\u679C\u6C41\uFF0C\u8BA9\u5B9D\u5B9D\u98DF\u7528\u65B0\u9C9C\u6C34\u679C\u8FDC\u6BD4\u559D\u679C\u6C41\u6709\u8425\u517B\uFF08\u679C\u6C41\u7CD6\u5206\u8FC7\u9AD8\uFF0C\u7EA4\u7EF4\u8FC7\u5C11\uFF09\u3002\u5982\u679C\u60A8\u4E00\u5B9A\u8981\u7ED9\u5B9D\u5B9D\u559D\u679C\u6C41\uFF0C\u90A3\u4E48\u5EFA\u8BAE\u7A00\u91CA\u7684\u679C\u6C41\uFF08\u679C\u6C41\u548C\u6C34\u7684\u6BD4\u4F8B\uFF1A1:3\uFF09\uFF0C\u63A7\u5236\u5728120\u6BEB\u5347\u4EE5\u5185\u3002\u53E6\u5916\uFF0C\u5927\u91CF\u7684\u679C\u6C41\u662F\u7981\u6B62\u7684\uFF0C\u56E0\u4E3A\u53EF\u80FD\u4F1A\u5BFC\u81F4\u86C0\u7259\u548C\u8179\u6CFB\u3002</p><p>\u5728\u8FD9\u4E2A\u9636\u6BB5\u7684\u5B9D\u5B9D\uFF0C\u6BCF\u5929\u7684\u80C3\u53E3\u53D8\u5316\u5F88\u5927\u3002\u5988\u5988\u4EEC\u4E0D\u9700\u8981\u56E0\u4E3A\u5B9D\u5B9D\u5076\u5C14\u7684\u98DF\u91CF\u53D8\u5C0F\u800C\u7D27\u5F20\u3002\u5728\u4E0D\u540C\u7684\u65E5\u5B50\uFF0C\u751A\u81F3\u540C\u4E00\u5929\u7684\u4E0D\u540C\u65F6\u95F4\u6BB5\uFF0C\u5B9D\u5B9D\u7684\u98DF\u6B32\u548C\u98DF\u91CF\u90FD\u53EF\u80FD\u51FA\u73B0\u5F88\u5927\u7684\u5DEE\u5F02\u3002\u5988\u5988\u4EEC\u5E94\u8BE5\u5C3D\u91CF\u8BA9\u5B9D\u5B9D\u81EA\u5DF1\u51B3\u5B9A\u6BCF\u6B21\u5403\u591A\u5C11\uFF0C\u5F3A\u8FEB\u5582\u98DF\u548C\u8FC7\u5EA6\u5582\u517B\u90FD\u4E0D\u53EF\u53D6\u3002</p><p>\u4EE5\u4E0A\u4FBF\u662F\u4E0E\u5582\u517B\u95EE\u9898\u76F8\u5173\u7684\u6FB3\u6D32\u5F53\u524D\u5EFA\u8BAE\u548C\u4FE1\u606F\u4E86\u3002\u5988\u5988\u4EEC\u53EF\u4EE5\u4E0E\u4E2D\u56FD\u7684\u5582\u517B\u6307\u5BFC\u8FDB\u884C\u6BD4\u5BF9\uFF0C\u7136\u540E\u6839\u636E\u81EA\u5DF1\u5B9D\u5B9D\u7684\u7279\u70B9\u548C\u5BB6\u5EAD\u7684\u996E\u98DF\u4E60\u60EF\uFF0C\u5EFA\u7ACB\u81EA\u5DF1\u7684\u79D1\u5B66\u5582\u517B\u6A21\u5F0F\u3002</p><hr><p>\u9898\u56FE\u6765\u81EApixabay,\u6388\u6743\u57FA\u4E8ECC0\u534F\u8BAE\u3002\u672C\u6587\u7531\u97E9\u533B\u751F\u6388\u6743\u8F6C\u8F7D\uFF0C\u97E9\u533B\u751F\u662F\u6FB3\u5927\u5229\u4E9A\u5987\u4EA7\u79D1\u533B\u5B66\u535A\u58EB\uFF0C\u4E34\u5E8A\u8425\u517B\u5B66\u7855\u58EB\uFF0C\u957F\u6309\u4E0B\u9762\u4E8C\u7EF4\u7801\u53EF\u4EE5\u5173\u6CE8\u5979\u7684\u516C\u4F17\u53F7\u3002\u76F8\u5173\u9605\u8BFB</p>',29),f=p("\u5582\u98DF\u5F3A\u8FEB\u75C7\u4F60\u6709\u6CA1\u6709\uFF1F"),m=p("\u5982\u4F55\u57F9\u517B\u5B69\u5B50\u81EA\u4E3B\u8FDB\u98DF"),x=p("\uFF1F"),u={href:"http://mp.weixin.qq.com/s?__biz=MzA5NzE5ODIyOQ==&mid=2651626135&idx=1&sn=a5e46eb804581f9473981ecf6dd37806&scene=21#wechat_redirect",target:"_blank",rel:"noopener noreferrer"},b=p("\u67E5\u770B\u539F\u6587");function z(g,k){const n=a("RouterLink"),r=a("ExternalLinkIcon");return c(),s(d,null,[h,e("p",null,[t(n,{to:"/s/__biz=MzA5NzE5ODIyOQ==&mid=401279117&idx=1&sn=d421297683d169846f05103b833cf1a7&scene=21#wechat_redirect/"},{default:o(()=>[f]),_:1})]),e("p",null,[t(n,{to:"/s/__biz=MzA5NzE5ODIyOQ==&mid=402104851&idx=1&sn=a062d5cf5c04d57b78d2cc5297aab3e2&scene=21#wechat_redirect/"},{default:o(()=>[m]),_:1}),x]),e("p",null,[e("a",u,[b,t(r)])])],64)}var E=i(l,[["render",z]]);export{E as default};
